import React, { Component } from 'react';
import Layout from './components/Layout/Layout'
import './App.css';
import { StyleRoot } from 'radium';
import { BrowserRouter } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div className="App">

          <StyleRoot>
            <BrowserRouter>
              <Layout />
            </BrowserRouter>  
          </StyleRoot> 

      </div>
    );
  }
}

export default App;
